import './SignIn.css'

const SignIn = () => {
    function checkSignIn(event){
        event.preventDefault();
        const formData = new FormData(event.target);
        const email = formData.get('email');
        const password = formData.get('password');

        const data = {
            email: email,
            password: password
        };

        fetch("/login", {
            method: "POST",
            body: JSON.stringify(data)
        })
        .then((response) => {
            response.json();
        })
        .then((result) => {
            if (result.message === "OK") alert("Success");
            else alert("fail");
        })
    }

    return (
        <>
            <div className="signInDiv">
                <form className="signInForm" onSubmit={checkSignIn}>
                    <h1 id="signInTitle" className="title"> Welcome back!</h1>
                    <label>
                        Email:<br />
                        <input type="email" name="name" /><br/><br/>
                    </label>
                    <label>
                        Password:<br />
                        <input type="password" name="name" /><br/><br/>
                    </label>
                    <input type="submit" value="Submit" className="submitButton"/>
                </form>
            </div>
            <div className="signUpDiv">
                <a className="signUpLink" href="http://localhost:3000/sign-up">Not a member yet? Sign up!</a>
            </div>
        </>
    )
}

export default SignIn;
